                crc = (crc >> 8) ^ crc_table[((value >> 16) & 0xFF) ^ (crc & 0xFF)]
                crc = (crc >> 8) ^ crc_table[((value >> 8) & 0xFF) ^ (crc & 0xFF)]
                crc = (crc >> 8) ^ crc_table[(value & 0xFF) ^ (crc & 0xFF)]
                
